use anyhow::{Result, Ok};
use std::{collections::{HashSet}};

const PROD: &'static str = "";


fn main() -> Result<()> {
    println!("{:?}", PROD
        .as_bytes()
        .windows(14)
        .enumerate()
        .filter(|(_, c)| c.iter().collect::<HashSet<&u8>>().len() == 14)
        .next()
    );
    return Ok(());
}